import React, {memo, useEffect} from 'react';
import styled from 'styled-components';

import Title from '../../components/TitleContainer';

const IndexContainer = styled.div`
    width:100%;
    color:#333333;
    
    .contentWrap{
        max-width: 1200px;
        height: auto;
        margin:auto;

        .searchWrap{
            margin-top:120px;
            border:1px solid #B3B3B3;
            border-radius: 10px;
            padding:32px 50px;
            color:#333333;
            display: flex;
            align-items: center;
            justify-content: center;

            label{
                font-size:18px;
                font-weight: 500;
                margin-right:20px;
            }

            select, input {
                border:1px solid #959595;
                border-radius: 4px;
                height: 38px;
                margin-right:40px;
                padding:0 14px;
            }
            .keySearchWrap{
                .keySearch{
                    margin-right:0;
                }
            }
        }

        .policyContentWrap{
            margin-top:90px;

            .total{
                text-align: center;
                font-size:24px;
                margin-bottom:50px;

                .point{
                    color:#34964B;
                    font-size:inherit
                }
            }

            .policyItem{
                width: 1200px;
                margin:0 auto;

                thead{
                    width:100%;
                    height:50px;
                    border-top:2px solid #333333;
                    border-bottom:1px solid #d9d9d9;
                    
                    tr{
                        height: 100%;
                        width:100%;
                        line-height: 50px;
                        text-align: center;

                        .num{width:5%;}

                        .reg{width:15%;}

                        .tit{width:45%;}

                        .pro{width:10%;}

                        .key{width:25%;}
                    }
                }

                tbody{
                    text-align: center;

                    .link{
                        display: flex;
                    }

                    tr{
                        border-bottom: 1px solid #d9d9d9;


                        td{
                            padding:18px 0;

                            &.reg{
                                color:#1F7A34;
                            }

                            &.pro{
                                border:1px solid #34964B;
                                display: inline-block;
                                padding:5px 0;
                                width:50px;
                                font-size:12px;
                                color:#34964B;
                                border-radius: 30px;
                            }

                            &.tit{
                                text-align: left;
                            }

                            &.key{
                                color:#959595;
                            }
                        }

                        
                    }
                }
            }
        }
    }

    
`;

const index = memo(() => {

    return (
        <IndexContainer>
            <Title title='취업지원' txt='취업 준비생 여러분의 취업을 돕기위한 정책들을 확인해보세요.' />
            <div className='contentWrap'>
                <form className='searchWrap'>
                    <div className='regSearchWrap'>
                        <label for='regionSearch'>지역 검색</label>
                        <select className='regSearch' id='regionSearch'>
                            <option value='all'>전체</option>
                            <option value='고용노동부'>고용노동부</option>
                            <option value='서울특별시'>서울특별시</option>
                            <option value='인천광역시'>인천광역시</option>
                            <option value='대전광역시'>대전광역시</option>
                            <option value='세종특별자치시'>세종특별자치시</option>
                            <option value='대구광역시'>대구광역시</option>
                            <option value='부산광역시'>부산광역시</option>
                            <option value='광주광역시'>광주광역시</option>
                        </select>
                    </div>
                    <div className='titSearchWrap'>
                        <label for='titleSearch'>제목 검색</label>
                        <input type='text' id='titleSearch' className='titSearch' />
                    </div>
                    <div className='keySearchWrap'>
                        <label for='keywordSearch'>키워드 검색</label>
                        <input type='text' id='keywordSearch' className='keySearch' />
                    </div>
                </form>
                <div className='policyContentWrap'>
                    <h1 className='total'>총 <string className='point'>10</string>개의 정책이 있습니다.</h1>
                    <table className='policyItem'>
                        <thead>
                            <tr>
                                <th className='num'>번호</th>
                                <th className='reg'>지역</th>
                                <th className='tit'>제목</th>
                                <th className='pro'>진행여부</th>
                                <th className='key'>키워드</th>
                            </tr>
                        </thead>
                        <tbody>
                            <a href='#' className='link'>
                            <tr>
                                <td className='num'>10</td>
                                <td className='reg'>서울특별시</td>
                                <td className='tit'>서울형 뉴딜 일자리</td>
                                <td className='pro'>진행중</td>
                                <td className='key'>일 경험,취업,취업역량,뉴딜 일자리,일자리</td>
                            </tr>
                            </a>
                        </tbody>
                    </table>
                </div>
            </div>
        </IndexContainer>
    );
});

export default index;
